package main

import (
	"container/heap"
	"slices"
)

func minimizeStringValue(s string) string {

	n := len(s)
	cnt := make([]int, 26)
	h := new(hp)
	for i := 0; i < n; i++ {
		if s[i] == '?' {
			continue
		}
		cur := s[i] - 'a'
		cnt[cur]++
	}

	for i, v := range cnt {
		heap.Push(h, pair{uint8(i + 'a'), v})
	}
	t := make([]uint8, 0)

	for i := 0; i < n; i++ {
		if s[i] == '?' {
			cur := heap.Pop(h).(pair)
			t = append(t, cur.index)
			heap.Push(h, pair{cur.index, cur.val + 1})

		}
	}
	slices.Sort(t)
	j := 0
	ans := []byte(s)
	for i, v := range ans {

		if v == '?' {
			ans[i] = t[j]
			j++
		}
	}
	return string(ans)
}

type pair struct {
	index uint8
	val   int
}
type hp []pair

func (h *hp) Less(i, j int) bool {
	if (*h)[i].val == (*h)[j].val {
		return (*h)[i].index < (*h)[j].index
	}
	return (*h)[i].val < (*h)[j].val
}
func (h *hp) Swap(i, j int) {

	(*h)[i], (*h)[j] = (*h)[j], (*h)[i]
}
func (h *hp) Len() int {
	return len(*h)
}

func (h *hp) Pop() (v any) {
	*h, v = (*h)[:h.Len()-1], (*h)[h.Len()-1]
	return
}

func (h *hp) Push(v any) {
	*h = append(*h, v.(pair))
}

